import React from 'react'

const Header = () => {
    const logo = <img src='https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png' alt='demo'/>
  return (
    <div className='header'>
        {logo}
        <></>
    </div>
    )
}

export default Header
